export class ScoreDAO {
    static createJoueur(nomJoueur, image){
        let joueur = new Joueur(nomJoueur, image);
        return joueur;
    }

    static saveJoueur(joueur){
        window.localStorage.setItem(joueur.nom, JSON.stringify(joueur));
    }

    static getJoueur(nomJoueur){
        let joueur = JSON.parse(window.localStorage.getItem(nomJoueur));
        if(joueur !== null){
            Object.setPrototypeOf(joueur, Joueur.prototype);
            if(joueur.photo !== undefined){
                Object.setPrototypeOf(joueur.photo, Image.prototype);
            }
        }
        return joueur;
    }
}

export class Joueur {
    constructor(nom, photo , victoires = 0, egalites = 0, defaites = 0) {
        this._nom = nom;
        this._photo = photo;
        this._victoires = victoires;
        this._egalites = egalites;
        this._defaites = defaites;
    }

    get nom() {
        return this._nom;
    }

    set nom(value) {
        this._nom = value;
    }

    get photo() {
        return this._photo;
    }

    set photo(value) {
        this._photo = value;
    }

    get victoires() {
        return this._victoires;
    }

    set victoires(value) {
        this._victoires = value;
    }

    get egalites() {
        return this._egalites;
    }

    set egalites(value) {
        this._egalites = value;
    }

    get defaites() {
        return this._defaites;
    }

    set defaites(value) {
        this._defaites = value;
    }
}